from fastapi import FastAPIfrom backend.app.api.students import router as stud_routerfrom backend.app.api.groups import router as group_routerfrom backend.app.api.subjects_semester import router as sub_semester_routerfrom fastapi.middleware.cors import CORSMiddlewareimport uvicornapp = FastAPI(title='my_mmf', debug=True, description='API_MY_MMF')app.include_router(stud_router)app.include_router(group_router)app.include_router(sub_semester_router)origins = [    'http://localhost:5174',    'http://127.0.0.1:517',]app.add_middleware(    CORSMiddleware,    allow_origins=origins,    allow_credentials=True,    allow_methods=['*'],    allow_headers=['*'],)if __name__ == "__main__":    uvicorn.run('main:app', reload=True)